import React from 'react'
let HeadStyles = {
  div: {
    backgroundColor: 'gold',
    height: '60px',
    paddingTop: 40,
  },
  span: {
    fontWeight: 'bold',
    paddingLeft: '20px',
  },
}
export const Head = () => {
  return (
    <div style={HeadStyles.div}>
      <span
        style={{
          fontWeight: 'bold',
          paddingLeft: '50px',
          hover: { fontSize: 30 },
        }}
      >
        Create Post
      </span>
      <span style={{ fontWeight: 'bold', paddingLeft: '50px' }}>
        Recent Posts
      </span>
      <span style={{ fontWeight: 'bold', paddingLeft: '50px' }}>
        Profile Setting
      </span>
      <span
        style={{ fontWeight: 'bold', paddingRight: '50px', float: 'right' }}
      >
        Welcome To Application
      </span>
    </div>
  )
}
